// src/pages/Services.js
import React, { useState } from 'react';
import '../styles/styles.css';

const Services = () => {
  const [exclusiveMeals, setExclusiveMeals] = useState([]);
  const [regularMeals, setRegularMeals] = useState([]);
  const [newExclusiveMeal, setNewExclusiveMeal] = useState({ name: '', description: '', image: '' });
  const [newRegularMeal, setNewRegularMeal] = useState({ name: '', description: '', image: '' });

  const addExclusiveMeal = () => {
    if (newExclusiveMeal.name && newExclusiveMeal.description && newExclusiveMeal.image) {
      setExclusiveMeals([...exclusiveMeals, newExclusiveMeal]);
      setNewExclusiveMeal({ name: '', description: '', image: '' }); // Reset form
    } else {
      alert("Please fill in all fields for the exclusive meal.");
    }
  };

  const addRegularMeal = () => {
    if (newRegularMeal.name && newRegularMeal.description && newRegularMeal.image) {
      setRegularMeals([...regularMeals, newRegularMeal]);
      setNewRegularMeal({ name: '', description: '', image: '' }); // Reset form
    } else {
      alert("Please fill in all fields for the regular meal.");
    }
  };

  return (
    <div>
      <div className="profile-container">
        <h1>Hall Services</h1>

        <h2>Add Exclusive Meal</h2>
        <input
          type="text"
          placeholder="Meal Name"
          value={newExclusiveMeal.name}
          onChange={(e) => setNewExclusiveMeal({ ...newExclusiveMeal, name: e.target.value })}
        />
        <input
          type="text"
          placeholder="Description"
          value={newExclusiveMeal.description}
          onChange={(e) => setNewExclusiveMeal({ ...newExclusiveMeal, description: e.target.value })}
        />
        <input
          type="text"
          placeholder="Image URL"
          value={newExclusiveMeal.image}
          onChange={(e) => setNewExclusiveMeal({ ...newExclusiveMeal, image: e.target.value })}
        />
        <button onClick={addExclusiveMeal}>Add Exclusive Meal</button>

        <h2>Add Regular Meal</h2>
        <input
          type="text"
          placeholder="Meal Name"
          value={newRegularMeal.name}
          onChange={(e) => setNewRegularMeal({ ...newRegularMeal, name: e.target.value })}
        />
        <input
          type="text"
          placeholder="Description"
          value={newRegularMeal.description}
          onChange={(e) => setNewRegularMeal({ ...newRegularMeal, description: e.target.value })}
        />
        <input
          type="text"
          placeholder="Image URL"
          value={newRegularMeal.image}
          onChange={(e) => setNewRegularMeal({ ...newRegularMeal, image: e.target.value })}
        />
        <button onClick={addRegularMeal}>Add Regular Meal</button>

        <h2>Exclusive Meals</h2>
        <ul>
          {exclusiveMeals.map((meal, index) => (
            <li key={index}>
              <img src={meal.image} alt={meal.name} style={{ width: '100px', height: '100px' }} />
              <h3>{meal.name}</h3>
              <p>{meal.description}</p>
            </li>
          ))}
        </ul>

        <h2>Regular Meals</h2>
        <ul>
          {regularMeals.map((meal, index) => (
            <li key={index}>
              <img src={meal.image} alt={meal.name} style={{ width: '100px', height: '100px' }} />
              <h3>{meal.name}</h3>
              <p>{meal.description}</p>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Services;
